import React from 'react';
import './App.css';
import { BrowserRouter, Route } from 'react-router-dom';
import Welcome from './components/Welcome';

function App() {
  return (
    // <div>Hello World!</div>
    <BrowserRouter>
      <Route path="/" components={Welcome} exact={true} />
    </BrowserRouter>
  );
}

export default App;
